/* eslint-disable jsx-a11y/label-has-associated-control */
import './App.css';
import React from 'react';
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
      <Navbar />
      <body>

        <div className="container-fluid">
          <div className="row align-items-center" id="d">
            <div className="col-4">
              <div className="form-group">
                <h1 id="c">Agenda Covid</h1>
                <label id="b">El Plan se hará en forma progresiva, escalonada y en el menor tiempo posible. Los plazos estarán condicionados a la llegada de las vacunas y se priorizarán los grupos según su función, riesgo de enfermar gravemente, riesgo de exposición y vulnerabilidad social.</label>
              </div>
              <div className="form-group d-flex flex-row justify-content-center">
                <a href="./agendarme.php">
                  <button id="a" type="submit" className="btn">Comenzar →</button>
                </a>
              </div>
            </div>
            <div className="col-8" id="132">
              <img className="bg-inicio" src="https://images.unsplash.com/photo-1607326207820-989c6d53a0a2?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1051&q=80" alt="foto" />
            </div>
          </div>
        </div>
      </body>

    </div>
  );
}

export default App;
